import React from 'react';
import {useNavigate} from "react-router-dom";
import homeStyles from '../../style/home/home.module.css'

const Home = () => {
	const navigate = useNavigate();

	const navigateTo = e => {
		e.preventDefault();
		navigate(`./${e.target.id}`);
	}


	return (
		<div className={homeStyles.entire}>
			<nav>
				{/*<Link to="edit">Edit</Link>*/}
				{/*<Link to="draft">Drafts</Link>*/}
				{/*<Link to="published">Published</Link>*/}
				{/*<Link to="involved">Involved</Link>*/}
				{/*<Link to="profile">Profile</Link>*/}
				{/*<Link to="setting">Setting</Link>*/}
				<div onClick={navigateTo} id='edit'>{'创建新问卷'}</div>
				<div onClick={navigateTo} id='draft'>{'查看草稿'}</div>
				<div onClick={navigateTo} id='published'></div>
				<div onClick={navigateTo} id='involved'></div>
				<div onClick={navigateTo} id='profile'></div>
				<div onClick={navigateTo} id='setting'></div>
			</nav>
		</div>
	);
};

export default Home;
